import classes from "./Post.module.css";

const Post = (props) => {


  const url = `https://maps.googleapis.com/maps/api/geocode/json?latlng=${props.lat},${props.long}&key=AIzaSyBZibHlhg2TX5MQuzQzr7h3cPTtZhfo7MY`;

  fetch(url)
  .then(res => res.json())
  .then(data => {
    console.log(data);
  });

  return (
    <div className={classes.post}>
      <div>
        <h2>{props.wasteType}</h2>
        <p>{props.lat}</p>
        <p>{props.long}</p>
      </div>
      <img className={classes.img} src={props.image} alt="react" />
    </div>
  );
};

export default Post;
